        'rek_pid': 'UQ:adad87c',
        'rek_title_xsdmf_id': null,
        'rek_title': 'Self-organizing polynomial neural network for modelling complex hydrological processes',
        'rek_description_xsdmf_id': null,
        'rek_description': 'Artificial neural networks (ANNs) have been used increasingly for modelling com-plex hydrological processes. In this paper, we present a self-organizing polynomial neural network (SOPNN) algorithm, which combines the theory of bio-cybernetic self-organizing polynomial (SOP) with the artificial neural network (ANN) approach. With the SOP feature of seeking the best combination of polynomial model parame-ters through optimal reduction of the partial polynomial nodes in the network and the ANN function of seeking minimum error at each layer of the network, the algorithm possesses superiority in nonlinear modelling of dynamic systems. The developed al-gorithm is applied to model a real-time rainfall-runoff process. The results demon-strate the capability of the SOPNN approach in addressing difficult issues of ANN modelling: selection of appropriate model inputs, optimization of the network struc-ture and error minimization. The comparison of modelling results shows that the SOPNN algorithm performs better in complex hydrological modelling than two other nonlinear approaches: the group method of data handling (GMDH) algorithm and the traditional back-propagation network (BPN) algorithm.',
