        'rek_formatted_title_xsdmf_id': 11438,
        'rek_formatted_title': 'Genome Variation in <i>Cryptococcus gattii<\/i>, an Emerging Pathogen of Immunocompetent Hosts',
        'rek_formatted_abstract_xsdmf_id': 11442,
        'rek_formatted_abstract': '<i>Cryptococcus gattii <\/i>recently emerged as the causative agent of cryptococcosis in healthy individuals in western North America, despite previous characterization of the fungus as a pathogen in tropical or subtropical regions. As a foundation to study the genetics of virulence in this pathogen, we sequenced the genomes of a strain (WM276) representing the predominant global molecular type (VGI) and a clinical strain (R265) of the major genotype (VGIIa) causing disease in North America. We compared these<i> C. gattii <\/i>genomes with each other and with the genomes of representative strains of the two varieties of <i>Cryptococcus neoformans <\/i>that generally cause disease in immunocompromised people. Our comparisons included chromosome alignments, analysis of gene content and gene family evolution, and comparative genome hybridization (CGH). These studies revealed that the genomes of the two representative <i>C. gattii <\/i>strains (genotypes VGI and VGIIa) are colinear for the majority of chromosomes, with some minor rearrangements. However, multiortholog phylogenetic analysis and an evaluation of gene\/sequence conservation support the existence of speciation within the <i>C. gattii <\/i>complex. More extensive chromosome rearrangements were observed upon comparison of the <i>C. gattii <\/i>and the <i>C. neoformans <\/i>genomes. Finally, CGH revealed considerable variation in clinical and environmental isolates as well as changes in chromosome copy numbers in <i>C. gattii <\/i>isolates displaying fluconazole heteroresistance. <br \/><br \/><b>IMPORTANCE<\/b> Isolates of <i>Cryptococcus gattii <\/i>are currently causing an outbreak of cryptococcosis in western North America, and most of the cases occurred in the absence of coinfection with HIV. This pattern is therefore in stark contrast to the current global burden of one million annual cases of cryptococcosis, caused by the related species <i>Cryptococcus neoformans<\/i>, in the HIV\/AIDS population. The genome sequences of two outbreak-associated major genotypes of <i>C. gattii <\/i>reported here provide insights into genome variation within and between cryptococcal species. These sequences also provide a resource to further evaluate the epidemiology of cryptococcal disease and to evaluate the role of pathogen genes in the differential interactions of <i>C. gattii <\/i>and <i>C. neoformans <\/i>with immunocompromised and immunocompetent hosts.',
